import React from 'react'

export function TodoList({ todos }){
    return (
        <div>
            {todos.map((todo, index) => {
                return (
                    <Todo
                        editTodo={editTodo}
                        deleteTodo={deleteTodo}
                        key={index}
                        index={index}
                        todo={todo}
                  />
                )
              })}
        </div>
    )
}


export default TodoList
